export const categories = [
  { value: '컴퓨터', label: '컴퓨터' },
  { value: '노트북', label: '노트북' },
  { value: '콘솔', label: '콘솔' },
  { value: '핸드폰', label: '핸드폰' },
  { value: '주변기기', label: '주변기기' },
  { value: '모니터', label: '모니터' }
];

export const exchangeCategorys = [
  { value: '중고', label: '중고' },
  { value: '미개봉', label: '미개봉' }
];
